import { useTranslation } from "react-i18next";
import styled from "styled-components";
import { useSelector } from "react-redux";

import { ComponentHeaderAuth, ComponentSignInTel } from "@components";
import { selectMerchant } from "@redux";
import { useHistory } from "react-router";

export const PageSignInTel = () => {
    //page hook
    const { t } = useTranslation();
    const history = useHistory();
    //page variable
    const merchant = useSelector(selectMerchant);
    const handleSignUp = () => {
        history.push(PATH_SIGN_UP_EMAIL);
    };
    return (
        <StyledContainer color={merchant.themeColor}>
            <ComponentHeaderAuth />
            <ComponentSignInTel />
            <div className="sign_in">
                {t("page.auth.already_have_an_account")} <span>{t("page.auth.sign_in")}</span>
            </div>
        </StyledContainer>
    );
};

const StyledContainer = styled.div<{ color: string }>`
    .sign_in {
        position: relative;
        top: -85px;
        text-align: end;
        margin: 36px 36px 0 0;
        font-style: normal;
        font-weight: bold;
        font-size: 16px;
        line-height: 21px;
        span {
            color: ${(p) => p.color};
            cursor: pointer;
        }
    }
`;
